import Layout from "components/Layout";
import { useGetCarrerasQuery } from "features/carrerasData";
import Select from 'react-select';
import React, { useEffect } from 'react';
import { useSelector,useDispatch } from "react-redux";
import { Navigate,Link } from "react-router-dom";
import { useState } from "react";
import { actualizarEstadoSolicitud,volverSolicitudesPendientesDetalleRamo } from "features/solicitud";
import { jsPDF,addImage } from "jspdf";
const DetalleSolicitudPendienteRamos = () => {

    const solicitud = useSelector(state => state.solicitudHandler.solicitud);
    const ramos = useSelector(state => state.solicitudHandler.ramos);
    const volver = useSelector(state => state.solicitudHandler.volverRamos)
    const dispatch = useDispatch();
    const {data} = useGetCarrerasQuery();
 
    if( volver == true && ramos == null) return <Navigate to="/menu/solicitudes-pendientes/detalle/"/>
    if(solicitud == null && ramos == null ) return <Navigate to="/menu/"/>
    const doc = new jsPDF();
    if(data != undefined){

        doc.setFont("Helvetica","bold")
        doc.setFontSize(12)
        doc.text("Facultad de Ingeniería y Ciencias Geológicas",60, 14);
        doc.text("Departamento de "+data[solicitud.carrera - 1].nombreCarrera,60, 20);
        doc.setFontSize(11)
        doc.text("FORMULARIO JUSTIFICACIÓN INASISTENCIA",62, 35);
        doc.text("IDENTIFICACIÓN DEL ALUMNO",16, 53);
        doc.line(16,54,74,54);
        doc.text("NOMBRE: "+solicitud.nombreAlumno,16, 63);
        doc.text("RUT: "+solicitud.rutAlumno,16, 73);
        doc.text("TELÉFONO: "+solicitud.telefono,16, 83);
        doc.text("CORREO INSTITUCIONAL: "+solicitud.correoAlumno,16, 93);
        doc.text("CARRERA: "+data[solicitud.carrera - 1].nombreCarrera,16, 103);
        doc.setLineWidth(0.4)
        doc.line(10,112,200,112);
        doc.text("FECHA A JUSTIFICAR: ",16, 125);
        doc.text("DESDE "+solicitud.fechaInicio+ "      HASTA "+solicitud.fechaTermino,60, 125);
        doc.text("(Formato: YYYY/MM/DD)",77, 130);
        doc.text("MOTIVO: "+ solicitud.motivo,16, 135);
        let dataRamos = []
        if(solicitud.cantRamos>=1){
            const ramo1 = {
                Codigo: ramos.asignatura1Codigo,
                Asignatura: ramos.asignatura1Nombre,
                NRC: ramos.asignatura1NRC,
                Docente: ramos.asignatura1NombreDoc,
                Correo_Docente: ramos.asignatura1CorreoDoc,
            }
            dataRamos.push(ramo1)
            if(solicitud.cantRamos>=2){
                const ramo2 = {
                    Codigo: ramos.asignatura2Codigo,
                    Asignatura: ramos.asignatura2Nombre,
                    NRC: ramos.asignatura2NRC,
                    Docente: ramos.asignatura2NombreDoc,
                    Correo_Docente: ramos.asignatura2CorreoDoc,
                }
                dataRamos.push(ramo2)
                if(solicitud.cantRamos>=3){
                    const ramo3 = {
                        Codigo: ramos.asignatura3Codigo,
                        Asignatura: ramos.asignatura3Nombre,
                        NRC: ramos.asignatura3NRC,
                        Docente: ramos.asignatura3NombreDoc,
                        Correo_Docente: ramos.asignatura3CorreoDoc,
                    }
                    dataRamos.push(ramo3)
                    if(solicitud.cantRamos>=4){
                        const ramo4 = {
                            Codigo: ramos.asignatura4Codigo,
                            Asignatura: ramos.asignatura4Nombre,
                            NRC: ramos.asignatura4NRC,
                            Docente: ramos.asignatura4NombreDoc,
                            Correo_Docente: ramos.asignatura4CorreoDoc,
                        }
                        dataRamos.push(ramo4)
                        if(solicitud.cantRamos>=5){
                            const ramo5 = {
                                Codigo: ramos.asignatura5Codigo,
                                Asignatura: ramos.asignatura5Nombre,
                                NRC: ramos.asignatura5NRC,
                                Docente: ramos.asignatura5NombreDoc,
                                Correo_Docente: ramos.asignatura5CorreoDoc,
                            }
                            dataRamos.push(ramo5)
                            if(solicitud.cantRamos>=6){
                                const ramo6 = {
                                    Codigo: ramos.asignatura6Codigo,
                                    Asignatura: ramos.asignatura6Nombre,
                                    NRC: ramos.asignatura6NRC,
                                    Docente: ramos.asignatura6NombreDoc,
                                    Correo_Docente: ramos.asignatura6CorreoDoc,
                                }
                                dataRamos.push(ramo6)
                            }
                        }
                    }
                }
            }
        }
        const headers = ["Codigo","Asignatura","NRC","Docente","Correo_Docente"]
        doc.table(14, 145,dataRamos,headers,{fontSize: 10});

        var imageDataUCNLogo = "data:image/png;base64,";
        doc.addImage(imageDataUCNLogo, 'png', 18, 15, 18, 18)
        var imageDataDIMMLogo = " data:image/jpeg;base64,";
        doc.addImage(imageDataDIMMLogo, 'png', 169, 15, 18, 18)
        var certificado = " data:image/png;base64,";
        doc.addImage(certificado, 'png', 18, 244, 180, 50)

    }


    const handleActualizarEstado = e =>{
        dispatch(actualizarEstadoSolicitud(solicitud.id));

    }
    const descargarPDF = e =>{
        doc.save("Formulario Justificativo Inasistencia "+solicitud.nombreAlumno+".pdf");
    }
    const volverHandler = () =>{
        dispatch(volverSolicitudesPendientesDetalleRamo())
    }
   
    return(
        <Layout title="Sistema justificacion" content="dashboard page">
  <div className="pt-16">   
        <div className="pt-16">
        <div className="pt-16">

            <div className="flex flex-col  px-6 mx-auto lg:py-6 bg-ucn-blue2 ml-20 mr-20 ">
            <div>
                <label className="font-bold">
                    Asignatura 1
                </label>
                <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura1Nombre}
                </div>
                <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg ">
                    NRC: {ramos.asignatura1NRC}
                </div>
                
                <div className=" font-bold mt-3  text-left bg-gray-500 p-1 rounded-lg ">
                    Nombre Docente: {ramos.asignatura1NombreDoc}
                </div>
                <div className=" font-bold mt-3 text-left mb-3 bg-gray-500 p-1 rounded-lg">
                Correo Docente: {ramos.asignatura1CorreoDoc}
            
               </div>
               <label className="font-bold">
                    Asignatura 2 <br></br>
                </label>
                {ramos.asignatura2Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura2Nombre}
                </div>}
                
                {ramos.asignatura2NRC && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    NRC: {ramos.asignatura2NRC}
                </div>}
                
                {ramos.asignatura2Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre Docente: {ramos.asignatura2NombreDoc}
                </div>}
                {ramos.asignatura2CorreoDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Correo Docente: {ramos.asignatura2CorreoDoc}
                </div>}
               <label className="font-bold">
                    Asignatura 3 <br></br>
                </label>
                {ramos.asignatura3Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura3Nombre}
                </div>}
                {ramos.asignatura3NRC && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    NRC: {ramos.asignatura3NRC}
                </div>}
                
                {ramos.asignatura3NombreDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre Docente: {ramos.asignatura3NombreDoc}
                </div>}
                {ramos.asignatura3CorreoDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Correo Docente: {ramos.asignatura3CorreoDoc}
                </div>}
               <label className="font-bold">
                    Asignatura 4 <br></br>
                </label>
                {ramos.asignatura4Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura4Nombre}
                </div>}
                {ramos.asignatura4NRC && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    NRC: {ramos.asignatura4NRC}
                </div>}
                
                {ramos.asignatura4NombreDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre Docente: {ramos.asignatura4NombreDoc}
                </div>}
                {ramos.asignatura4CorreoDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Correo Docente: {ramos.asignatura4CorreoDoc}
                </div>}
               <label className="font-bold">
                    Asignatura 5<br></br>
                </label>
                {ramos.asignatura5Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura3Nombre}
                </div>}
                {ramos.asignatura5NRC && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    NRC: {ramos.asignatura5NRC}
                </div>}
                
                {ramos.asignatura5NombreDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre Docente: {ramos.asignatura5NombreDoc}
                </div>}
                {ramos.asignatura5CorreoDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Correo Docente: {ramos.asignatura5CorreoDoc}
                </div>}
               <label className="font-bold">
                    Asignatura 6 <br></br>
                </label>
                {ramos.asignatura6Nombre && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre: {ramos.asignatura6Nombre}
                </div>}
                {ramos.asignatura6NRC && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    NRC: {ramos.asignatura6NRC}
                </div>}
                
                {ramos.asignatura6NombreDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Nombre Docente: {ramos.asignatura6NombreDoc}
                </div>}
                {ramos.asignatura6CorreoDoc && <div className=" font-bold mt-3 text-left bg-gray-500 p-2 rounded-lg">
                    Correo Docente: {ramos.asignatura6CorreoDoc}
                </div>}
            </div>

            <div className=" grid-columns-2 ">
                <button onClick={() => handleActualizarEstado()} className=" mb-4  text-sm bg-sky-500 hover:bg-sky-900 focus:ring-4 p-3 rounded-lg font-bold mt-3 text-left  ">
                    Actualizar Estado Solicitud
                </button>
                <button onClick={() => descargarPDF()} className=" mb-4 ml-3 text-sm bg-sky-500 hover:bg-sky-900 focus:ring-4 p-3 rounded-lg font-bold mt-3 text-left  ">
                    Descargar PDF justificativo
                </button>
               
            </div>
            <div className="columns-2 mb-6">
             <button onClick={()=> volverHandler()} className="  text-sm ml-15 bg-green-500 hover:bg-green-700 focus:ring-4 p-3 rounded-lg  font-bold mt-5 text-center py-3">Volver</button>
             </div>
            </div>
        </div>
        
        </div>
        </div>
        </Layout>
    );
};

export default DetalleSolicitudPendienteRamos;